import "./App.css";
import axios from 'axios';
import React, {useState, useEffect} from 'react';


function App() {

  const [coins, setCoins] = useState([])
  useEffect(() => {
    axios.get("htps://api.coingecko.com/api/v3/coins/markets?vs_currency=cad&order=market_cap_desc&per_page=100&page=1&sparkline=false").then(res => {
      setCoins(res.data)
    }).catch(error => alert("The API has failed."))
  }, []);

  return (
    <div className="App">
      <h1> API</h1>
    </div>
  );
}

export default App;
